import React, { Component } from "react";
import Jumbotron from "../components/Jumbotron";
import { Col, Row, Container } from "../components/Grid";

function Home() {
    return (
        <Container fluid>
            <Jumbotron fluid>
                <h1 className="Display-4">
                    Menu Ville
               </h1>
            </Jumbotron>
            <Row>
                <Col size = "md-12">
                    <Jumbotron>
                        <p className = "lead">
                            Get inside our delicious menu, order your preferred dishes
                        </p>
                    </Jumbotron>
                </Col>
            </Row>

        </Container>
    );
}

export default Home;
